import React, { useState, useEffect } from 'react';
import './PlayersPage.css';

interface Player {
  id: string;
  name: string;
  country: string;
  rank: number;
  points: number;
}

interface ApiResponse {
  rankings?: Player[];
  players?: Player[];
  data?: any;
  [key: string]: any; // Allow for unknown response structures
}

const PlayersPage: React.FC = () => {
  const [players, setPlayers] = useState<Player[]>([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState<string | null>(null);
  const [debugInfo, setDebugInfo] = useState<string>('');

  useEffect(() => {
    const fetchPlayers = async () => {
      try {
        setLoading(true);
        setError(null);
        setDebugInfo('Starting API call...');

        // Only try the backend proxy - no more direct API calls
        const backendUrl = 'http://localhost:5000/api/golf/rankings';

        console.log(`Fetching from backend: ${backendUrl}`);
        setDebugInfo(`Calling backend: ${backendUrl}`);

        const response = await fetch(backendUrl, {
          method: 'GET',
          headers: {
            'Accept': 'application/json',
            'Content-Type': 'application/json',
          },
        });

        console.log(`Response status: ${response.status}`);
        // console.log(`Response headers:`, [...response.headers.entries()]);

        if (!response.ok) {
          const errorText = await response.text();
          console.error(`Backend error:`, errorText);
          throw new Error(`Backend Error (${response.status}): ${errorText}`);
        }

        const data: ApiResponse = await response.json();
        console.log('Raw API Response:', data);
        console.log('Response keys:', Object.keys(data));

        // Try to extract players from different possible response structures
        let playersData: Player[] = [];

        if (data.rankings && Array.isArray(data.rankings)) {
          playersData = data.rankings;
          setDebugInfo(`Found ${playersData.length} players in 'rankings' field`);
        } else if (data.players && Array.isArray(data.players)) {
          playersData = data.players;
          setDebugInfo(`Found ${playersData.length} players in 'players' field`);
        } else if (Array.isArray(data)) {
          playersData = data;
          setDebugInfo(`Found ${playersData.length} players in root array`);
        } else {
          // Check for nested data structures
          const possibleArrays = Object.values(data).filter(Array.isArray);
          if (possibleArrays.length > 0) {
            playersData = possibleArrays[0] as Player[];
            setDebugInfo(`Found ${playersData.length} players in nested array`);
          } else {
            console.log('Unexpected data structure:', data);
            setDebugInfo(`Unexpected response format. Keys: ${Object.keys(data).join(', ')}`);
            throw new Error(`No player array found in response. Available keys: ${Object.keys(data).join(', ')}`);
          }
        }

        if (playersData.length === 0) {
          throw new Error('No player data found in response');
        }

        // Validate and clean the data
        const validPlayers = playersData
          .filter(player => player && player.name && player.rank)
          .map(player => ({
            id: player.id || `player-${player.rank}`,
            name: player.name,
            country: player.country || 'Unknown',
            rank: Number(player.rank),
            points: Number(player.points) || 0
          }))
          .sort((a, b) => a.rank - b.rank)
          .slice(0, 20); // Top 20 players

        setPlayers(validPlayers);
        setDebugInfo(`Successfully loaded ${validPlayers.length} valid players`);
        setError(null); // Clear any previous errors

      } catch (err: any) {
        console.error('API Error:', err);

        // Provide specific error messages
        let errorMessage = 'Unknown error occurred';

        if (err.message.includes('Failed to fetch') || err.message.includes('NetworkError')) {
          errorMessage = 'Cannot connect to backend server. Make sure your backend is running on http://localhost:5000';
        } else if (err.message.includes('Backend Error')) {
          errorMessage = err.message;
        } else if (err.message.includes('No player')) {
          errorMessage = `API returned data but no players found: ${err.message}`;
        } else {
          errorMessage = `API Error: ${err.message}`;
        }

        setError(errorMessage);
        setDebugInfo(`Error: ${err.message}`);

        // Don't load mock data - let's fix the real API
        setPlayers([]);

      } finally {
        setLoading(false);
      }
    };

    fetchPlayers();
  }, []);

  const renderPlayerCard = (player: Player | null, index: number) => (
    <div key={index} className="player-card">
      {player ? (
        <>
          <div className="player-rank">#{player.rank}</div>
          <h3 className="player-name">{player.name}</h3>
          <p className="player-country">{player.country}</p>
          <div className="player-points">
            {typeof player.points === 'number' && player.points > 0
              ? `${player.points.toFixed(3)} points`
              : 'N/A points'
            }
          </div>
        </>
      ) : (
        <>
          <div className="player-rank placeholder">#--</div>
          <h3 className="player-name placeholder">Loading...</h3>
          <p className="player-country placeholder">--</p>
          <div className="player-points placeholder">-- points</div>
        </>
      )}
    </div>
  );

  return (
    <div className="players-page">
      <header className="page-header">
        <h1>World Golf Rankings</h1>
        <p>Current top players in professional golf</p>
      </header>

      {/* Debug Info */}
      {debugInfo && (
        <div className="debug-info">
          <small>Debug: {debugInfo}</small>
        </div>
      )}

      {loading && (
        <div className="loading-container">
          <p>Loading players from API...</p>
        </div>
      )}

      {error && (
        <div className="error-container">
          <h3>ðŸš¨ API Connection Issue</h3>
          <p><strong>Error:</strong> {error}</p>
          <details>
            <summary>Troubleshooting Steps</summary>
            <ul>
